import React from 'react';

class Resistance extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        if(this.props.type1 == 0){
            return (
                <td></td>
            )
        } else {
            return (
                <td>{this.props.type1}, {this.props.type2}</td>
                );
        }
    }
};

export default Resistance;
